        {
            if (datos.Count > 0)
            {
                datos.RemoveAt(datos.Count - 1);
            }
        }
        else
        {
            if (dato.All(char.IsDigit))
            {
                datos.Add(dato);
            }
        }
        string resu = "";
        foreach (var item in datos)
        {
            resu += item;
        }
        if (resu== "")
        {
            resu = "0";
        }
        Cambio = Convert.ToDecimal(resu) - TotalFacturar;
    }

